type CharMapping =
     | CommonMapping  of int
     | SimpleMapping  of int
     | TurkishMapping of int
     | FullMapping1 of int
     | FullMapping2 of int*int
     | FullMapping3 of int*int*int

let hex2int c = (int c &&& 15) + (int c >>> 6)*9 // hex char to int

let pCodePoint =
    manyMinMaxSatisfyL 4 5 isHex "codepoint with 4-5 hex digits"
    |>> fun s ->
            let mutable n = 0
            for i = 0 to s.Length - 1 do
                n <- n*16 + hex2int s.[i]
            n

let semi = skipString "; "
let space = skipChar ' '

let pCharMapping =
    pipe3 pCodePoint (semi >>. anyChar) (semi >>. sepBy pCodePoint space .>> (semi >>. skipRestOfLine true))
          (fun fromChar c toChars ->
              match c with
              | 'C' -> match toChars with
                       | [n0] -> (fromChar, CommonMapping n0)
              | 'S' -> match toChars with
                       | [n0] -> (fromChar, SimpleMapping n0)
              | 'T' -> match toChars with
                       | [n0] -> (fromChar, TurkishMapping n0)
              | 'F' -> match toChars with
                       | [n0]         -> (fromChar, FullMapping1(n0))
                       | [n0; n1]     -> (fromChar, FullMapping2(n0, n1))
                       | [n0; n1; n2] -> (fromChar, FullMapping3(n0, n1, n2)))

let pAllMappings = many pCharMapping .>> eof

let parseMappings() =
    match run pAllMappings datastr with
    | Success(xs, _,_) -> xs
    | Failure(msg,_,_) -> failwith msg

let getOneToOneMappings() =
    parseMappings()
    |> List.choose (function (src, CommonMapping(dst))
                           | (src, SimpleMapping(dst))
                             when src < 0xffff
                               -> Some (char src, char dst)
                           | _ -> None)

let getOneToOneMappingsAsStrings() =
    let pairs = getOneToOneMappings()
    let sb = new System.Text.StringBuilder()
    for c1, c2 in pairs do
        let c1s, c2s = (int c1).ToString("X4"), (int c2).ToString("X4")
        sb.Append("\u").Append(c1s).Append("\u").Append(c2s) |> ignore
    sb.ToString()


let writeOneToOneMappingsToFile(path) =
    use file = new System.IO.StreamWriter(path, false, System.Text.Encoding.UTF8)
    let one2ones = getOneToOneMappingsAsStrings()
    file.WriteLine(one2ones)
    file.Close()

writeOneToOneMappingsToFile(@"c:\temp\one2onemappings.txt")

